import React from 'react'
import './Footer.css'
import dh from '../../Imagenes/DH.png'
import dhblanco from '../../Imagenes/descarga-blanca.png'
import { useGlobalContext } from '../global.context'



const Footer = () => {
  const {global, isDark, changeTheme} = useGlobalContext()

  return (
    <footer className={isDark() ? "footer-dark" : "footer"} >

              <img 
             src={dhblanco}
             alt="DH logo"
             width="70%"
             />

    </footer>
  )
}

export default Footer
